// src/App.js
import React from 'react';
import './App.css';   // This is for styling, if you want to keep it
import FilmList from './controller/FilmList';   // Import the FilmList component

function App() {
  return (
      <div className="App">
        <h1>Welcome to Film Tracker!</h1>
        <FilmList />   {/* Include the FilmList component here */}
      </div>
  );
}

export default App;
